import React from "react";
import './Profile.css'

function Profile({user}) {
    const calcNutrient = (user, index) => {
        let total = 0;
        user.foods.map((value, key) => {
            total += value.foodNutrients[index].value
            return total
        })
        return total
    }

    if (user == null) {
        return (
            <div className="profile">
                <p className="error">Log in to access this feature</p>
            </div>
        )
    }
    else {
        return (
            <div className="profile">
                <ul className="macros">
                    <li>{calcNutrient(user, 0)}</li>
                    <li>{calcNutrient(user, 1)}</li>
                    <li>{calcNutrient(user, 2)}</li>
                </ul>
                
            </div>
        )
    }
}

export default Profile
